import App from "../App";

export default function Header (data) {
    console.log(data);
    return(
        <div>
            <h2>{data.tit.welcome}</h2>
            <h3>{data.tit.title}</h3>
            <p>{data.tit.subtitle}</p>
        </div>

    );
};
